/*Table structure for table `group_change_requests` */

DROP TABLE IF EXISTS `group_change_requests`;

CREATE TABLE `group_change_requests` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `business_owner_id` int(11) NOT NULL,
  `profession_id` int(11) NOT NULL,
  `group_id` int(11) NOT NULL,
  `proposed_meeting_time` time NOT NULL,
  `request_type` enum('cr','k_off') NOT NULL COMMENT 'cr: Group change k_off: kicked off',
  `is_moved` tinyint(1) NOT NULL DEFAULT '0',
  `created` datetime NOT NULL,
  `modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `group_change_requests` */

/*Table structure for table `groups` */

DROP TABLE IF EXISTS `groups`;

CREATE TABLE `groups` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `group_name` varchar(255) NOT NULL,
  `group_type` enum('global','local') NOT NULL,
  `first_meeting_date` date DEFAULT NULL,
  `second_meeting_date` date DEFAULT NULL,
  `meeting_time` time DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `state_id` int(11) DEFAULT NULL,
  `city_id` int(11) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `zipcode` varchar(255) DEFAULT NULL,
  `timezone_id` int(4) DEFAULT NULL,
  `total_member` tinyint(1) DEFAULT NULL,
  `group_leader_id` int(11) DEFAULT NULL,
  `group_coleader_id` int(11) DEFAULT NULL,
  `shuffling_date` datetime DEFAULT NULL,
  `group_created_by` int(11) DEFAULT NULL,
  `group_modified_by` int(11) DEFAULT NULL,
  `is_active` enum('y','n') NOT NULL DEFAULT 'y',
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=96 DEFAULT CHARSET=latin1;

