  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `username` varchar(100) NOT NULL,
  `user_email` varchar(60) NOT NULL,
  `password` varchar(100) NOT NULL,
  `pass_reset_hash` varchar(255) DEFAULT NULL,
